`},{path:"/article/2f45bq9x/",title:"跨域资源共享(CORS)",categoryList:[{id:"72e6d5",sort:1,name:"前端"},{id:"2a0632",sort:8,name:"HTTP"}],tags:["http"],createTime:"2020/08/29 07:40:31",lang:"zh-CN",excerpt:`<p><strong>跨域资源共享（CORS）</strong> 是一种基于 <strong>HTTP Header</strong> 的机制。
